import React, { Component, createContext } from 'react'
//import '../App.css'


class Header extends React.Component {
    constructor(props) {
      super(props);
    
  
    }
  
   
  
    render() {
      return (
        <header>
        <div class="main">
            
              
                <button><a href="#"><img src={'images/carwalelogo.png'} width="30" height="30" /></a></button>
                <button><a href="#"><img src={'images/locationLogo.png'} width="30" height="30" /></a></button>
                
           
        </div>
    </header>
      );
    }
  }
  



export default Header;
